import React from "react";
import AppHome from "./AppHome";
import AppService from "./AppService";
import AppContact from "./AppContact";
import AppAbout from "./AppAbout";
import AppMenu from "./AppMenu";
import { Switch , Route } from "@material-ui/icons";


const App = () => {
    return (
        <>
            <Switch>
                <Route exact to="/" component={AppHome}></Route>
                <Route exact to="/service" component={AppService}></Route>
                <Route exact to="/contact" component={AppContact}></Route>
                <Route exact to="/about" component={AppAbout}></Route>
                <Route exact to="/menu" component={AppMenu}></Route>
            </Switch>
        </>
    );
}

export default App;
